            </>)
    }

}

function Stage1Output(props){
    return (
        <>
            <div className="w3-row-padding">
            <h3 className="w3-bar w3-light-grey"> Stage 1: Enconding Selection</h3>
            </div>
        </>
    )
}

export default Recommendation;
